(752, 20, 'AEME Hooded Zip Sweat Vis a Vis Gr.XS', '', '<br>Äußerst angenehm zu tragende und softe Kapuzensweatjacke in tollem hell- und dunkelblau von Aeme. Die aufgesetzten seitlichen Eimngrifftaschen in Form des Aeme-Spatzes runden das ganze hinreißend ab.  <br><br> Material: 65% Baumwolle, 35% Polyester<br> Farbe: dark blue/ light blue', NULL, '2013-04-24', 0, 1, 0, 0, '1', '2013-04-24 21:38:21', NULL, 0, NULL, 0, 0, 0, '', 0, 1813, NULL, NULL, 857),
(753, 20, 'AEME Sweat Zip Frau Lehmann Gr.L', '', '<br>Länger geschnittene Sweatjacke in schöner Farbkonstellation aus dem Hause Aeme. Der Kragen lässt sich bei Bedarf extra hoch schließen und seitliche Eingrifftaschen sorgen für warme Hände.  <br><br> Material: 65% Baumwolle, 35% Polyester<br> Farbe: grey/white/light blue', NULL, '2013-04-24', 1, 1, 0, 0, '1', '2013-04-24 21:38:21', NULL, 0, NULL, 0, 0, 0, '', 0, 1814, NULL, NULL, 858),
