(762, 5, '* DERBE Coat Gezeiten Friese navy Gr.L', '', '<br>Herrlich warmer Daunenwintermantel von Derbe und die Gans bleibt auch noch ganz! Mit Pflanzendaunen des Kapokbaumes gefüttert, ist diese Jacke zu 100% vegan und damit eine glückliche \\"Daunen\\" Jacke! Sie zeichnet sich durch eine natürliche Wärme- und Feuchteregulierung aus, ist atmungsaktiv und extrem leicht und besitzt von daher einen extrem hohen Tragekomfort. <br><br>  * durchgehender Reißverschluss, mit Druckknopfleiste verdeckt<br> * seitliche Eingrifftaschen, mit Druckknopf schließbar<br> * Tunnelzug in der Kapuze<br> * breite elastische Rippstrickbündchen in den Ärmelabschlüssen<br> * Tunnelzug mit Draw-Strings im Abschlusssaum<br> * Kunstfellkragen per Druckknopfleiste abnehmbar<br> * atmungsaktiv<br> * wasserabweisend<br> * winddicht<br><br> Größe S = 36<br> Größe M = 38<br> Größe L = 40<br><br>  Material: <br> Außenmaterial: 75% Baumwolle, 25% Nylon<br> Innenmaterial: 100% Nylon<br> Futter: 100% Kapok<br> Farbe: navy<br><br>      ', NULL, '2013-04-24', 0, 1, 0, 0, '1', '2013-04-24 21:38:22', NULL, 0, NULL, 0, 0, 0, '', 0, 1829, NULL, NULL, 867),
