(850, 14, 'SKUNKFUNK Sare Gr.S', '', '<br> Cooler witziger Schnitt, locker im Schritt und deshalb bequem zu tragen. Der Overall hat zwei Taschen, hat einen Gummizug in der Taillie und ist ein absolutes Highlight im Kleiderschrank!<br><br>   Material: 100% Baumwolle<br> Farbe: petrol<br><br>           ', NULL, '2013-04-24', 0, 1, 0, 0, '1', '2013-04-24 21:38:36', NULL, 0, NULL, 0, 0, 0, '', 0, 2035, NULL, NULL, 955),
