(52, 'Frontend', 'HeidelPayment', 'Heidelpay Payment Standard', 'Default', '<p><img src="data:image/png;base64," /></p> <p style="font-size:12px; font-weight: bold;">Heidelberger Payment GmbH - Ihr Full Service Payment Provider - alles aus einer Hand <p></p> <p style="font-size:12px">Die Heidelberger Payment GmbH kurz: heidelpay bietet als BaFin-zertifizierter Payment Service Provider alles was zum Online-Payment geh&ouml;rt.<br><br><a href="http://testshops.heidelpay.de/contactform/?campaign=shopware4.0&shop=shopware4.0" target="_blank" style="font-size: 12px; color: #000;  font-weight: bold;">&gt;&gt;&gt; Informationen anfordern &lt;&lt;&lt;</a><br/><p><br /> <p style="font-size:12px">Das Leistungsspektrum des PCI DSS zertifizierten Unternehmens reicht von weltweiten e-Payment L&ouml;sungen, inklusive eines vollst&auml;ndigen Debitorenmanagement-, Risk- und Fraud- Systems bis hin zu einem breiten Angebot alternativer Bezahlverfahren - schnell, sicher, einfach und umfassend - alles aus einer Hand.</p><br/> <a href="http://www.heidelpay.de" style="font-size: 12px; color: #000;  font-weight: bold;">www.heidelpay.de</a><br/> <br/> <p style="font-size: 12px; color: #f00";  font-weight: bold;">Hinweis:</p><p style="font-size:12px">Um unser "Heidelpay Actions Standard" Plug-in nutzen zu k&ouml;nnen, beantragen Sie bitte die Aufschaltung von push Benachrichtigungen bei unserem Technischen Support. Wenden Sie sich hierf&uuml;r bitte per email an technik@heidelpay.de oder Telefon +49 (0) 6221 65170-10 an uns. Bitte notieren Sie sich Sie sich vorher die URL ihres e-Shops plus dem Webpfad zur Heidelpay Action und teilen Sie uns diese dann mit, als Beispiel<br/><br/> <b>https://www.meinshop.de/payment_heidelpay/rawnotify</b></p>', NULL, 0, '2013-04-03 13:19:15', NULL, NULL, '2013-04-03 19:43:17', 'Heidelberger Payment GmbH', 'Copyright © 2012, Heidelberger Payment GmbH', 'commercial', '12.08', 'technik@heidelpay.de', NULL, 'http://www.heidelpay.de/', NULL, NULL, 1, 1, 1, NULL, NULL),
(53, 'Frontend', 'PaymentSkrill', 'PaymentSkrill', 'Default', 'Skrill (Moneybookers) ist die sichere Art, weltweit zu bezahlen, ohne ihre Bezahldaten jedesmal neu einzugeben.\n				    Sie können in 200 Ländern über 100 verschiedene Zahlungsoptionen nutzen, einschließlich aller wichtigen Kredit- und EC- Karten.', NULL, 0, '2013-04-03 13:19:15', NULL, NULL, '2013-04-03 19:43:17', 'Skrill Holdings Ltd.', 'Copyright © 2012, shopware AG', '', '2.0.0', 'http://wiki.shopware.de', '[changelog]', 'http://www.skrill.com/', NULL, NULL, 1, 1, 1, NULL, NULL),
(54, 'Frontend', 'PaymentSofort', 'SOFORT Gateway', 'Default', '\n			<h2></h2>\n			<p></p>\n		', NULL, 0, '2013-04-03 13:19:15', NULL, NULL, '2013-04-03 19:43:18', 'SOFORT AG', 'SOFORT AG, 2012', '', '1.0.1', 'https://www.payment-network.com/sue_de/integration/list/88', '', 'http://www.sofort.com', NULL, NULL, 1, 1, 1, NULL, NULL),
(55, 'Frontend', 'PigmbhKlarnaPayment', 'Klarna Payment Module', 'Default', '<p><img src="data:image/png;base64," /></p>\n                <p style="font-size:12px">\n                Bitte bearbeiten Sie alle mit Klarna Rechnung und Klarna Ratenzahlung gezahlten Rechnungen nur in unserer eigenen Rechnungsverwaltung, damit alle &Auml;nderungen an Klarna &uuml;bermittelt werden.<br />\n                Diese finden Sie unter Kunden->Zahlungen->Klarna (nach dem aktualisieren der Seite)<br />\n                <span style="color:red;font-size">Bitte beachten Sie, das f&uuml;r Klarna Ratenzahlung kein Zahlartenaufschlag festgelegt werden darf(laut dt. Gesetz). Jeder Aufschlag auf Klarna Rate wird im Checkout auf 0 gesetz.</span></p><p style="font-size:80%">Wenn Sie keine H&auml;ndler ID und/oder kein Secret haben, besuchen Sie nun unsere <a href="https://merchants.klarna.com/signup/de?locale=de&partner_id=26e1c567a525192f6dcb8bfbfe2e714e488a84bf"target="_blank" title="Zur H&auml;ndlerregistrierung von Klarna">H&auml;ndlerregistrierung</a> und erstellen Sie sich Ihr Konto bei Klarna.</p>\n            ', NULL, 0, '2013-04-03 13:19:15', NULL, NULL, '2013-04-03 19:43:18', 'Payintelligent GmbH', 'Copyright (c) 2012, Payintelligent GmbH', '', '2.0.7', 'http://www.payintelligent.de/', NULL, 'http://www.payintelligent.de/', NULL, NULL, 1, 1, 1, NULL, NULL),
(56, 'Frontend', 'PigmbhRatePAYPayment', 'RatePAY Payment Module', 'Default', '', NULL, 0, '2013-04-03 13:19:15', NULL, NULL, '2013-04-03 19:43:18', 'Payintelligent GmbH', 'Copyright (c) 2011-2012, Payintelligent GmbH', '', '2.0.8', 'http://www.payintelligent.de/', 'Ready for Shopware 3.5.4 - 3.5.6', 'http://www.payintelligent.de/', NULL, NULL, 1, 1, 1, NULL, NULL),
(57, 'Frontend', 'PiPaymorrowPayment', 'Paymorrow Payment Module', 'Default', NULL, NULL, 0, '2013-04-03 13:19:15', NULL, NULL, '2013-04-03 19:43:18', 'Payintelligent GmbH', 'Copyright (c) 2012, Payintelligent GmbH', NULL, '1.2.3', 'http://www.payintelligent.de/', NULL, NULL, NULL, NULL, 1, 1, 1, NULL, NULL),
(58, 'Frontend', 'SwagPaymentBillsafe', 'BillSAFE Payment', 'Default', NULL, NULL, 0, '2013-04-03 13:19:15', NULL, NULL, '2013-04-03 19:43:18', 'shopware AG', 'Copyright © 2012, shopware AG', NULL, '1.0.0', NULL, NULL, NULL, NULL, NULL, 1, 1, 1, NULL, NULL),
(59, 'Frontend', 'SwagPaymentPaypal', 'PayPal Payment', 'Default', '<h1>Das ist PayPal Express</h1>\n<br />\n<p>Sobald Sie PayPal Express in Ihren Shop integriert haben, öffnen Sie die Tür zu 15 Millionen PayPal-Kunden und einer durchschnittlichen Umsatzsteigerung von 18,7%.<a href="#footnote-1"><abbr title="E-Commerce Center Handel, IZH6 Studie, Köln 2012"><sup>[1]</sup></abbr></a> Denn deutsche Online-Käufer sind besonders sicherheitsbewusst und halten beim Einkauf gezielt Ausschau nach PayPal.</p>\n<br />\n<p>\n<ul>\n<li>· Die Integration ist schnell erledigt.</li>\n<li>· Der Bezahlprozess ist für mobile Geräte optimiert.</li>\n<li>· Keine Einrichtungskosten oder monatlichen Grundgebühren.</li>\n<li>· Sobald Sie Geld empfangen, erheben wir eine Gebühr von 1,9% plus 0,35 Euro.</li>\n</ul>\n<a href="https://www.paypal-deutschland.de/haendler/was-ist-PayPal/das-kostet-PayPal.html" target="_blank">Weitere Information zu PayPal und entstehenden Kosten</a>\n</p>\n<br />\n<h1>Los geht’s</h1>\n<br />\n<strong>So eröffnen Sie ein Geschäftskonto</string>\n\n<p>Der Anmeldeprozess gliedert sich in drei einfache Schritte. Was Sie dazu brauchen? Ihre Firmen- und Bankdaten, E-Mail-Adresse und gegebenenfalls Ihre Steuernummer.</p>\n\n<p><strong>· Schritt 1:</strong> Klicken Sie auf "Jetzt Konto eröffnen" und geben Sie Ihre Geschäftsdaten ein.</p>\n<p><strong>· Schritt 2:</strong> Bestätigen Sie Ihre E-Mail-Adresse.</p>\n<p><strong>· Schritt 3:</strong> Fügen Sie nun noch Ihr Bankkonto Ihrem PayPal-Konto hinzu. Fertig.</p>\n\n\n<p>Nachdem Sie jetzt noch Ihr Bankkonto bestätigt haben, wird Ihnen Ihr Integrations-Partner eine einfache Anleitung geben, wie Sie den PayPal-Express-Button in Ihren Shop einbauen können.\n<br />\n<input value="JETZT KONTO ERÖFFNEN" onclick="window.open(''http://altfarm.mediaplex.com/ad/ck/3484-158045-8030-0?PMA4=Shopware&PMA5=Cart&PMA6=Backend&PMA7=Profilseite&PMA8=Signup&mpro=https://www.paypal.com/de/cgi-bin/webscr?cmd=_registration-run-validated&account_type=2&country=DE&cid=MGWNA3M2236ULYNN'');"  type="button" /><br />\n\n<p>Haben Sie Fragen? Dann <a href="https://www.paypal-deutschland.de/haendler/kontakt/index.html" target="_blank">schreiben Sie uns</a> oder rufen uns direkt an:  01805 23 32 05.</p>\n<br />\n<small><p id="footnote-1">[1] *E-Commerce Center Handel, IZH6 Studie, Köln 2012.</p></small>', NULL, 1, '2013-04-03 13:19:15', '2013-04-03 13:22:24', '2013-04-03 13:22:24', '2013-04-03 19:43:18', 'shopware AG', 'Copyright © 2012, shopware AG', NULL, '2.1.1', NULL, NULL, NULL, NULL, NULL, 1, 1, 1, NULL, NULL),
